import Card from "../UI/Card";
import Style from "./Cart.module.css"

export default function Cart(){
    return (
        <Card className={Style.bump}>
        <button className={Style.button}>
            <img className={Style.icon}></img>
            <p >Your Cart</p>
            <p className={Style.badge}>0</p>
        </button>
        </Card>
    );
}
